import React from 'react'
import "../styles/ListItem.css"

export default function ListItem({item, user}) {

    return (
        <div className={"listItem"}>
            {
                item.details !== "" ? (
                    <div className={"msgContainer"}>
                        {
                            user.name === item.user ? (
                                <>
                                    <p className={"text timestamp you"}>{item.timestamp}</p>
                                    <p className={"text msgInfo you"} style={{color: user.color}}>{item.user}</p>
                                    <p className={"text you"}>Hi</p>
                                </>
                            ) : (
                                <>
                                    <p className={"timestamp text"}>{item.timestamp}</p>
                                    <p className={"msgInfo text"} style={{color: user.color}}>{item.user}</p>
                                    <p className={"text"}>Hi</p>
                                </>
                            )
                        }


                    </div>

                ) : (
                    <p className={"text"}>{item.user}</p>
                )
            }
        </div >
    )
}
